import styled from "styled-components";
import Wrapper from "./Wrapper";
import { Link } from "react-router-dom";
const StyledHeader = styled.header<{ active: number }>`
  height: 60px;
  position: fixed;
  width: 100%;
  z-index: 120;
  .wrapper {
    position: relative;
    height: 100%;
    display: flex;
    align-items: center;
    justify-content: space-between;
    .search {
      flex: 1;
      width: 100%;
    }
  }

  .title {
    position: absolute;
    left: 0%;
    text-decoration: none;
    font-weight: blod;
    font-family: "Dongle", sans-serif;
    font-size: 20px;
    color: white;
  }

  .logo img {
    width: 163.65px;
    height: 30.79px;
  }
  .nav-list {
    align-items: center;
    flex: 1;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    font-size: 1.5rem;
    .nav:nth-child(${(props) => props.active}) {
      border-bottom: 4px solid #03008a;
    }
    .nav {
      font-weight: bold;
      cursor: pointer;
      padding-bottom: 0.75rem;
      border-bottom: 4px solid transparent;
    }
  }

  .login {
    position: absolute;
    right: 7%;
    text-decoration: none;
    font-size: 20px;
    font-family: "Dongle", sans-serif;
    display: flex;
    //justify-content: flex-end;
    align-items: center;
    color: white;
  }

  .join {
    position: absolute;
    right: 0%;
    text-decoration: none;
    font-size: 20px;
    font-family: "Dongle", sans-serif;
    display: flex;
    align-items: center;
    color: white;
  }
`;

type HeaderProps = {
  children?: React.ReactElement;
  active: number;
};

function Header(props: HeaderProps) {
  return (
    <StyledHeader active={props.active}>
      <Wrapper className="wrapper">
        <div className="logo">
          <Link to={"/"}>
            <img src="/icon/WorldTone.png" alt="logo"></img>
          </Link>
        </div>
        <div className="nav-list">
          <Link to={"/"} className="nav">
            더빙 목록
          </Link>
          <Link to={"/create"} className="nav">
            더빙 파일 만들기
          </Link>
        </div>
        <Link className="login" to="/login">
          로그인
        </Link>
        <Link className="join" to="/join">
          회원가입
        </Link>
      </Wrapper>
    </StyledHeader>
  );
}
export default Header;
